import React from 'react';
import HeaderLink from './HeaderLink';

function Header() {
  return (
    <div className="header">
    	<HeaderLink linkName="Dev Profile" linkURL="http://nicoleannelopez.com"/>
    	<HeaderLink linkName="Blog" linkURL="https://nicoleannelopez.wordpress.com"/>
    </div>
  );
}

export default Header;
